import React from "react";
import { Link } from "react-router-dom";
import { Button } from "reactstrap";

const MyStadiums = () => {
  return (
    <div>
      <h1>My Stadiums</h1>
      <Link to="/stadiumform">
        <Button color="success">Add a stadium</Button>
      </Link>
    </div>
  );
};

export default MyStadiums;
